import React from "react";
import Galeria from "../Galeria/Galeria";
import "./Inicio.css";
import Menu from "./Menu";
const Inicio = () => {
	return (
		<div className="home-slider owl-carousel pr-0">
			<section className="home-slider">
				<div className="slider-item slider ">
					<div className="overlay"></div>
					<div className="container">
						<div
							className="row no-gutters slider-text align-items-center justify-content-start"
							data-scrollax-parent="true"
						>
							<div className="col-md-12">
								<h2 className="text">
									Eventos de empresa, Bodas, Fiestas privadas, Conferencias,
									Congresos...
								</h2>
								
							</div>
							
						</div>
						<Menu />
						<Galeria/>
						<br />
					</div>
				</div>
			</section>
		</div>
	);
};

export default Inicio;
